import React from "react";

const Todo = ({ todo, deleteTodo }) => {
  const { id, isDone, todoTitle } = todo;
  return (
    <div>
      <h3>{todo.todoTitle}</h3>
      <p>{todo.isDone.toString()}</p>
      <button>수정</button>
      <button
        onClick={() => {
          deleteTodo(id);
        }}
      >
        삭제
      </button>
    </div>
  );
};

export default Todo;
